import { useEffect } from "react";
import ApiService from "./ApiService";

function Movie() {
    let apiService = new ApiService();
    useEffect(() => {
        apiService.getAllMovies().then(
            (res) => {
                console.log("Response is ready ...");
                console.log(res.data);
            }
        );
    },[]);
    return <div>
        <h1 >Movies</h1>
    </div>
}

export default Movie;
